import React, { useState,useEffect } from 'react';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';

import './App.css';

function App() {

  const [value, onChange] = useState(new Date());
  useEffect(()=>{
    alert(value);
  },[value]);

  return (
    <div>
      <Calendar
        onChange={onChange}
        value={value}
        minDate={Date.now()}
      />
    </div>
  );

}

export default App;
